-- Volcando estructura para procedimiento landing-projects.login
DROP PROCEDURE IF EXISTS `login`;
DELIMITER //
CREATE
    DEFINER = `root`@`localhost` PROCEDURE `login`(IN `_username` VARCHAR(50),
                                                   IN `_password` TEXT)
BEGIN
    select *
    from users u
    where u.username = _username
      and u.password = SHA2(_password, 224);
END//
DELIMITER ;

